function findRemovedProjects(dbValues, backupValues) {
  const mixed = [];
  dbValues.forEach((dbValue) => {
    const backupValue = backupValues.find((val) => val.locator === dbValue.locator);
    if (backupValue && backupValue.locationId !== dbValue.remoteId) {
      mixed.push(
        {...dbValue, correctLocationId: backupValue.locationId}
      );
    }
  });
  mixed.forEach((val) => {
    if (val && !val.remoteId) {
      val.remoteId = 'undefined';
    }
  });
return mixed;
}

